DROP TABLE users CASCADE CONSTRAINTS;
DROP TABLE trades CASCADE CONSTRAINTS;
DROP TABLE shares CASCADE CONSTRAINTS;
DROP TABLE companies CASCADE CONSTRAINTS;
DROP TABLE CurrentTrades CASCADE CONSTRAINTS;
DROP TABLE ownedshares CASCADE CONSTRAINTS;
DROP TABLE sharesprices CASCADE CONSTRAINTS;
DROP TABLE trackedshare CASCADE CONSTRAINTS;

CREATE TABLE users (USERID NUMBER(19) NOT NULL, ADMINBOOLEAN NUMBER(10) NULL, BANNED NUMBER(10) NULL, CREDIT NUMBER(19,4) NULL, EMAIL VARCHAR2(255) NULL, IMAGEFILE BLOB NULL, PASSWORD VARCHAR2(255) NULL, USERNAME VARCHAR2(255) NULL, PRIMARY KEY (USERID));
CREATE TABLE trades (TRADEID NUMBER(19) NOT NULL, PRICETOTAL NUMBER(19,4) NULL, QUANTITY NUMBER(19,4) NULL, TRANSACTIONTIME TIMESTAMP NULL, buyer_id NUMBER(19) NULL, seller_id NUMBER(19) NULL, SHARE_SHAREID NUMBER(19) NULL, PRIMARY KEY (TRADEID));
CREATE TABLE shares (SHAREID NUMBER(19) NOT NULL, COMPANY_COMPANYID NUMBER(19) NULL, PRIMARY KEY (SHAREID));
CREATE TABLE companies (COMPANYID NUMBER(19) NOT NULL, BIO VARCHAR2(1024) NULL, INDUSTRY VARCHAR2(255) NULL, NAME VARCHAR2(255) NULL, PRIMARY KEY (COMPANYID));
CREATE TABLE ownedShares (OWNEDSHAREID NUMBER(19) NOT NULL, PRICEPERSHARE NUMBER(19,4) NULL, QUANTITY NUMBER(19,4) NULL, SHARE_SHAREID NUMBER(19) NULL, user_id NUMBER(19) NULL, PRIMARY KEY (OWNEDSHAREID));
CREATE TABLE currentTrades (SHAREPRICEID NUMBER(19) NOT NULL, AMOUNTBUYING NUMBER(19,4) NULL, AMOUNTSELLING NUMBER(19,4) NULL, BUYPRICE NUMBER(19,4) NULL, SELLPRICE NUMBER(19,4) NULL, TIMEPOSTED TIMESTAMP NULL, share_id NUMBER(19) NULL, user_id NUMBER(19) NULL, PRIMARY KEY (SHAREPRICEID));
CREATE TABLE sharesprices (SHARESPRICESID NUMBER(19) NOT NULL, PRICE NUMBER(19,4) NULL, TIMESTAMP TIMESTAMP NULL, SHARE_SHAREID NUMBER(19) NULL, PRIMARY KEY (SHARESPRICESID));
CREATE TABLE TrackedShare (TRACKEDID NUMBER(19) NOT NULL, USER_USERID NUMBER(19) NULL, SHAREPRICE_SHARESPRICESID NUMBER(19) NULL, PRIMARY KEY (TRACKEDID));

ALTER TABLE trades ADD CONSTRAINT FK_trades_buyer_id FOREIGN KEY (buyer_id) REFERENCES users (USERID);
ALTER TABLE trades ADD CONSTRAINT FK_trades_seller_id FOREIGN KEY (seller_id) REFERENCES users (USERID);
ALTER TABLE trades ADD CONSTRAINT FK_trades_SHARE_SHAREID FOREIGN KEY (SHARE_SHAREID) REFERENCES shares (SHAREID);
ALTER TABLE shares ADD CONSTRAINT FK_shares_COMPANY_COMPANYID FOREIGN KEY (COMPANY_COMPANYID) REFERENCES companies (COMPANYID);
ALTER TABLE ownedShares ADD CONSTRAINT FK_ownedShares_SHARE_SHAREID FOREIGN KEY (SHARE_SHAREID) REFERENCES shares (SHAREID);
ALTER TABLE ownedShares ADD CONSTRAINT FK_ownedShares_user_id FOREIGN KEY (user_id) REFERENCES users (USERID);
ALTER TABLE currentTrades ADD CONSTRAINT FK_currentTrades_user_id FOREIGN KEY (user_id) REFERENCES users (USERID);
ALTER TABLE currentTrades ADD CONSTRAINT FK_currentTrades_share_id FOREIGN KEY (share_id) REFERENCES shares (SHAREID);
ALTER TABLE sharesprices ADD CONSTRAINT FK_sharesprices_SHARE_SHAREID FOREIGN KEY (SHARE_SHAREID) REFERENCES shares (SHAREID);
ALTER TABLE TrackedShare ADD CONSTRAINT TrckdShreSHRPRCESHARESPRICESID FOREIGN KEY (SHAREPRICE_SHARESPRICESID) REFERENCES sharesprices (SHARESPRICESID);
ALTER TABLE TrackedShare ADD CONSTRAINT FK_TrackedShare_USER_USERID FOREIGN KEY (USER_USERID) REFERENCES users (USERID);












